/*Table structure for table `tbl_users` */

DROP TABLE IF EXISTS `tbl_users`;

CREATE TABLE `tbl_users` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `Username` varchar(12) NOT NULL,
  `Password` varchar(12) NOT NULL,
  `Secret_Question` varchar(50) NOT NULL,
  `Secret_Answer` varchar(50) NOT NULL,
  PRIMARY KEY (`Id`),
  UNIQUE KEY `UQ_tbl_users_Username` (`Username`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;

/*Data for the table `tbl_users` */

insert  into `tbl_users`(`Id`,`Username`,`Password`,`Secret_Question`,`Secret_Answer`) values (5,'yaw','yaw','What is your favorite color?','JCM');

/* Procedure structure for procedure `sp_DeleteExistingStudent` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_DeleteExistingStudent` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_DeleteExistingStudent`(IN param_StudentId int)
BEGIN
DELETE FROM cs_students.tbl_Students WHERE Id=param_StudentId;
END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_InsertNewStudent` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_InsertNewStudent` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_InsertNewStudent`(IN param_LastName varchar(16), 
IN param_GivenName varchar(16),IN param_MiddleName varchar(16), IN param_GenderId int, IN param_DateOfBirth date,
IN param_Age int, IN param_Address mediumtext ,IN param_Photo longblob)
BEGIN
INSERT INTO tbl_Students (Last_Name,Given_Name, Middle_Name, Gender_Id, Date_of_Birth, Age, Address, Photo)
VALUES (param_LastName, param_GivenName, param_MiddleName , param_GenderId, param_DateOfBirth,
param_Age, param_Address, param_Photo);
END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_InsertNewUser` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_InsertNewUser` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_InsertNewUser`(IN param_Username varchar(12),IN param_Password varchar(12),
IN param_SecretQuestion varchar(50),IN param_SecretAnswer varchar(50))
BEGIN
INSERT INTO tbl_Users ( username, password, secret_question, secret_answer )
VALUES (param_Username, param_Password, param_SecretQuestion, param_SecretAnswer);
END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_UpdateExistingStudent` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_UpdateExistingStudent` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_UpdateExistingStudent`(IN param_LastName varchar(16), 
IN param_GivenName varchar(16),IN param_MiddleName varchar(16), IN param_GenderId int, IN param_DateOfBirth date,
IN param_Age int, IN param_Address mediumtext ,IN param_Photo longblob, IN param_StudentId int)
BEGIN
UPDATE tbl_Students SET last_name = param_LastName, given_name = param_GivenName,
middle_name = param_MiddleName, gender_id = param_GenderId, date_of_birth = param_DateOfBirth,
age = param_Age, address = param_Address, photo = param_Photo 
WHERE Id=param_StudentId;
END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_GetStudentByAddress` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_GetStudentByAddress` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_GetStudentByAddress`(IN param_Address mediumtext)
BEGIN
 SELECT 
        `cs_students`.`tbl_students`.`Id` AS `STUDENT ID`,
        `cs_students`.`tbl_students`.`Last_Name` AS `LAST NAME`,
        `cs_students`.`tbl_students`.`Given_Name` AS `GIVEN NAME`,
           `cs_students`.`tbl_students`.`Middle_Name` AS `MIDDLE NAME`,
        `cs_students`.`tbl_genders`.`Gender` AS `GENDER`,
        `cs_students`.`tbl_students`.`Date_of_Birth` AS `DATE OF BIRTH`,
        `cs_students`.`tbl_students`.`Age` AS `AGE`,
        `cs_students`.`tbl_students`.`Address` AS `ADDRESS`,
        `cs_students`.`tbl_students`.`Photo` AS `PHOTO`
    FROM
        (`cs_students`.`tbl_students`
        JOIN `cs_students`.`tbl_genders` ON ((`cs_students`.`tbl_students`.`Gender_Id` = `cs_students`.`tbl_genders`.`Id`)))
    WHERE
        (`cs_students`.`tbl_students`.`Address` LIKE param_Address)
    ORDER BY `cs_students`.`tbl_students`.`Id`;
END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_GetStudentByAge` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_GetStudentByAge` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_GetStudentByAge`(IN param_Age int)
BEGIN
 SELECT 
        `cs_students`.`tbl_students`.`Id` AS `STUDENT ID`,
